	@Order(DEV_SECURITY_CONFIGURATION_ORDER)
	public WebSecurityCustomizer webSecurityCustomizer() {
		return (web) -> web.ignoring().requestMatchers("/console/**/**");
	}

	@Bean
	@Order(DEV_SECURITY_CONFIGURATION_ORDER)
	public SecurityFilterChain securityFilterChain(HttpSecurity http) throws Exception {
		http.authorizeHttpRequests(authz -> authz
				// Un-secure H2 Database
				.requestMatchers("/console/**/**").permitAll()
				.anyRequest().authenticated())
			// disable page caching
			.headers(headers -> headers
				.frameOptions(frameOptions -> frameOptions.sameOrigin()) // required to set for H2 else H2 Console will be blank
				.cacheControl(cache -> {}))
			.csrf(csrf -> csrf.ignoringRequestMatchers("/console/**"));

		return http.build();
	}

